import FooterHome from "../components/footerHome";

export default function Home() {
	return (
		<div className="fullHome">
			<div className="folderIcon">
				<div className="folderIcon1">

				</div>
				<div className="folderIcon2"></div>
				<div className="folderIcon3"></div>
				<div className="folderIcon4"></div>
				<div className="folderIcon5"></div>
				<div className="folderIcon6"></div>
			</div>
			<FooterHome />
		</div>
	);
}
